                <text transform="translate(840 471.75)"
                      style="font-size:16px;fill:#fff;font-family:Old-Newspapers-Sung, Old Newspapers Sung">
                    “瞿”通“戵”，戟一类的兵器。
                    <tspan x="-8" y="36">亦通“衢”，意为四通八达的道路。</tspan>
                    <tspan x="-88" y="72">武汉，固有九省通衢之称，地处中南，中国交通要塞之一。</tspan>
                    <tspan x="40" y="108">疫情之下，安有完卵。</tspan>
                    <tspan x="16" y="144">这座中心城市封闭七十六日。</tspan>
                    <tspan x="40" y="180">但江城闭，城却不孤。</tspan>
                    <tspan x="-16" y="216">众志成城，各省源源不断的输送物资，</tspan>
                    <tspan x="-18.66" y="252">以物流之利“瞿”，“行” 应急之路。</tspan>
                </text>

            <g>
                <text transform="translate(1091.98 566.87)"
                      style="font-size:16px;fill:#fff;font-family:Old-Newspapers-Sung, Old Newspapers Sung">
                    1月23日，随着封城的实施，武汉市内原本的物流运输渠道也随之失去了原本的秩序。
                    <tspan x="0" y="56">1月24日，注定是个不平凡的除夕之夜,江城失去了往昔的熙熙攘攘，医院的储备已供不应求，超市也</tspan>
                    <tspan x="0" y="84">早就被洗劫一空。</tspan>
                    <tspan x="0" y="140">1月25日，国家召开紧急会议，启动支援应急物流的一系列举措。供应端补给充足、绿色通道开启、</tspan>
                    <tspan x="0" y="168">干线运输畅通、应急物资源源不断地涌向江城。</tspan>
                    <tspan x="0" y="224">但是，市民的补给被卡在了最后一公里……</tspan>
                    <tspan x="0" y="280">近2/3的快递驿站关停，大量的终端派送员离开岗位，江城的物流面临着前所未有的挑战。</tspan>
                </text>
                <text id="carText" opacity="0" transform="translate(1091.98 566.87)"
                      style="font-size:16px;fill:#fff;font-family:Old-Newspapers-Sung, Old Newspapers Sung">
                    <tspan x="0" y="336">平凡的城市英雄接过了快递员的接力棒。外卖小哥、公交司机、安保人员，还有小商贩……自愿冲上</tspan>
                    <tspan x="0" y="364">了配送第一线，打通了物流终端的最后一公里。</tspan>
                </text>
